(function($){Drupal.behaviors.seo_checklist={attach:function(context){$("#checklistapi-checklist-form fieldset a",context).filter(function(){return this.href.indexOf("http")===0}).filter(function(){return this.hostname&&this.hostname!==location.hostname}).each(function(){$(this).attr("target",this.hostname==="drupal.org"?"drupal_org":"_blank")})}}})(jQuery);